// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;
pragma abicoder v2;

import "@openzeppelin/contracts/token/ERC1155/ERC1155.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/Counters.sol";
import "./INFTFactory.sol";

contract NextItem is ERC1155, INFTFactory, Ownable {

    using Counters for Counters.Counter;
    Counters.Counter private _tokenIds;

    mapping(address => bool) private _operators;
    mapping(uint256 => string) private _metadata;
    mapping(uint256 => address) private _creators;

    event NewItemMinted(
        address indexed sender,
        address creator,
        uint256 tokenId,
        uint256 quantity,
        string metadata
    );

    event ItemMinted(
        address indexed sender,
        uint256 tokenId,
        uint256 quantity
    );

    event ItemBurned(
        address indexed sender,
        uint256 tokenId,
        uint256 quantity
    );

    event NextItemOperatorUpdated(
        address indexed sender,
        address operator,
        bool approved
    );

    event ItemMetadataUpdated(
        address indexed sender,
        uint256 tokenId,
        string metadata
    );

    constructor(string memory baseURI) ERC1155(baseURI) {
        _operators[msg.sender] = true;
    }

    modifier isValidTokenId(uint256 tokenId) {
        require(tokenId < _tokenIds.current(), "Invalid tokenId");
        _;
    }

    modifier onlyOperators() {
        require(_operators[msg.sender], "Operator required");
        _;
    }

    function updateOperator(address operator, bool approved)
        public
        onlyOwner
    {
        _operators[operator] = approved;
        emit NextItemOperatorUpdated(msg.sender, operator, approved);
    }

    function isOperator(address addr)
        public
        view
        returns (bool)
    {
        return _operators[addr];
    }

    function mintNewItem(uint256 quantity, address creator, string memory metadata)
        public 
        onlyOwner 
    {
        uint256 tokenId = _tokenIds.current();
        _mint(msg.sender, tokenId, quantity, "");
        _creators[tokenId] = creator;
        _metadata[tokenId] = metadata;
        _tokenIds.increment();

        emit NewItemMinted(msg.sender, creator, tokenId, quantity, metadata);
    }

    function updateItemMetadata(uint256 tokenId, string memory metadata)
        public 
        onlyOwner
        isValidTokenId(tokenId)
    {
        _metadata[tokenId] = metadata;

        emit ItemMetadataUpdated(msg.sender, tokenId, metadata);
    }

    function uri(uint256 tokenId)
        public view override 
        isValidTokenId(tokenId)
        returns (string memory)
    {
        return _metadata[tokenId];
    }

    function mintMoreItem(uint256 tokenId, uint256 quantity)
        public 
        onlyOwner
        isValidTokenId(tokenId)
    {
        _mint(msg.sender, tokenId, quantity, "");
        emit ItemMinted(owner(), tokenId, quantity);
    }

    function burnItem(uint256 tokenId, uint256 quantity)
        public 
        onlyOperators
        isValidTokenId(tokenId)
    {
        _burn(msg.sender, tokenId, quantity);
        emit ItemBurned(owner(), tokenId, quantity);
    }

    function mintBatch(address recipient, uint256[] memory itemIds, uint256[] memory amounts)
        public
        onlyOperators   // improve suggestion: only allow for unpacking
    {
        _mintBatch(recipient, itemIds, amounts, "0x0");
    }

    function getUniqueTokenNum()
        public 
        view 
        virtual override 
        returns (uint256)
    {
        return _tokenIds.current();
    }
}
